import {createMuiTheme} from '@material-ui/core/styles';


const theme = createMuiTheme({
    typography: {
        useNextVariants: true, 
        fontFamily: [
            'Roboto, Arial',
            '"Bebas Neue"'
    ]
    },
    palette: {
        primary: {
            main: '#F5F000',

        },
        secondary: {
            light: 'ff80ab',
            main: '#f50057',
            dark: '#c51162',
            contrastText: '#ffff',
        },
        background:{
            default: "#ffff"
        },
    },
    shape: {
        borderRadius: 10
    }
    
});

export default theme;
